function LoadsPage({ loads }) {

  const loadsList = loads.map(load => {
    return (
      <li key={load.id}>
        <button className="card-btn delete">Load Identification Number: {load.id}More Details</button>
      </li>
    )
  })

  return (
    <div className="card">
      <ul>
        {loadsList}
      </ul>
    </div>
  )

}

export default LoadsPage;
